import React from "react";
import "./Sidebar.css";
import Logo from "../../assests/logo.svg";

const Sidebar = () => {
  return (
    <aside className="aside">
      <a href="#home" className="nav__logo">
        <img src={Logo} alt="" />
      </a>
      <nav className="nav">
        <div className="nav__menu"></div>
      </nav>
    </aside>
  );
};

export default Sidebar;
